import rectangle from '../../img/rectangle-7-11.png';
import rectanglePanel from '../../img/rectangle-9.svg';
import polygon3 from '../../img/polygon-3.svg';
import likeButton from '../../img/icon-3.svg';
import checkButton from '../../img/vector-81.svg';

export default function Locations() {
    return (
        <div className="flex flex-col items-start gap-3 relative self-stretch w-full flex-[0_0_auto]">
            <div className="relative self-stretch mt-[-1.00px] font-semibold text-[#7a7a7a] text-sm leading-[15.9px]">
                800sqft with View
            </div>
            <div className="flex flex-col items-center justify-center gap-[13px] w-full flex-[0_0_auto]">
                <PropertyListing />
                <LoadmoreButton />
            </div>
        </div>
    );
}

function PropertyListing(props) {
    const {
        propertyName='Property name',
        address='(3806 W 20th Ave, Kennewick, WA 99338)',
        suggestedRentValue=1234,
        rent=123,
        floorNumber=10,
        stories=6,
        avgUnitSize='741 SF',
        views=20,
        showings=20,
        date='12.12.2024',
        parking='-',
        type='Apartments - All',
        distance='-'
    } = props;

    return (
        <div className="relative w-[1013px] h-[186px]">
            <div className="relative h-[186px]">
                <img className="w-[798px] absolute h-[186px] top-0" alt="Rectangle" src={rectanglePanel} />
                <div className="absolute w-[184px] h-[111px] top-[58px] left-[806px]">
                    <div className="absolute w-[186px] h-[41px] top-[70px] left-0 border border-solid border-black rounded-[23.5px]">
                        <div className="absolute top-4 left-[13px] font-semibold text-black text-xs whitespace-nowrap">
                            View Rental Comparisons
                        </div>
                    </div>
                    <div className="absolute w-[131px] h-[47px] top-0 left-[57px]">
                        <div className="absolute h-6 top-0 left-0 font-bold text-orange text-xl whitespace-nowrap">
                            {suggestedRentValue}
                        </div>
                        <div className="absolute h-5 top-[27px] left-0 font-normal text-[#918f8f] text-base whitespace-nowrap">
                            Suggested Rent
                        </div>
                    </div>
                </div>
                <img className="w-[343px] absolute h-[186px] top-0" alt="Rectangle" src={rectangle} />
                <ActiveListingTag />
                <CardValues {...props} />
                <img className="absolute w-[15px] h-[13px] top-16 left-[843px]" alt="Polygon" src={polygon3} />
            </div>
        </div>
    );
}

function ActiveListingTag() {
    return (
        <div className="absolute w-[21px] h-[59px] top-0 left-[324px]">
            <div className="relative w-[19px] h-[59px] bg-[#ff914d] rounded-[1.13px_8.48px_9.61px_9.61px]">
                <div className="absolute h-2.5 top-[25px] -left-3 rotate-[90.00deg] font-bold text-white text-[7px] whitespace-nowrap">
                    Active Listing
                </div>
            </div>
        </div>
    );
}

function CardValues({
    propertyName='Property name',
    address='3806 W 20th Ave, Kennewick, WA 99338',
    amenities='Amenities - View, Balcony, Garage, Dishwasher, Fitness Center',
    suggestedRentValue=1234,
    rent=123,
    floorNumber=10,
    stories=6,
    avgUnitSize='741 SF',
    views=20,
    showings=20,
    date='12.12.2024',
    parking='-',
    type='Apartments - All',
    distance='-'
}) {
    return (
        <div className="absolute w-[464px] h-[157px] top-[23px] left-[372px]">
            <p className="absolute h-3.5 top-[25px] left-0 font-normal text-[#2a2a33] text-xs whitespace-nowrap">
                {amenities}
            </p>
            <p className="absolute h-3.5 top-0 left-0 font-normal text-black text-xl whitespace-nowrap">
                <span className="font-bold">{propertyName}</span>
                <span className="font-semibold text-sm"> {address}</span>
            </p>
            <div className="absolute w-[460px] h-24 top-[61px] left-0 flex flex-wrap items-start gap-[21px_13px]">
                <CardValue label="Rent/SqFt" value="$1,075" />
                <CardValue label="Rent" value={rent} />
                <CardValue label="Floor Number" value={floorNumber} />
                <CardValue label="Stories" value={stories} />
                <CardValue label="Avg. Unit Size" value={avgUnitSize} />
                <CardValue label="No. Viewed" value={views} />
                <CardValue label="No. Showings" value={showings} />
                <CardValue label="Lease Expiry" value={date} />
                <CardValue label="Parking" value={parking} />
                <CardValue label="Type" value={type} />
                <CardValue label="Distance to Transit" value={distance} />
            </div>
        </div>
    );
}

function CardValue({ label, value }) {
    return (
        <div className="flex flex-col w-fit items-start gap-[1.89px] relative">
            <div className="font-bold text-black text-xs">{value}</div>
            <div className="font-normal text-[#918f8f] text-[10px]">{label}</div>
        </div>
    );
}

function LoadmoreButton() {
    return (
        <div className="relative w-[124px] h-[47px]">
            <div className="relative w-[122px] h-[47px] bg-black rounded-[23.5px]">
                <div className="absolute top-4 left-[30px] font-semibold text-white text-xs text-center">
                    Load More
                </div>
            </div>
        </div>
    );
}
